	CREATE TABLE Results(
		ID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
		studentID int NULL,
		deliveryID int NOT NULL,
		startTime datetime NOT NULL,
		duration int NULL,
		IPaddress int NULL,
		scorePointsCorrect real NULL,
		scorePointsPossible real NULL,
		sectionID int NULL,
		siteID int NULL,
		assocResultID int NULL,
		deleted bit NULL,
		testName varchar(100) NULL,
		scoreSent datetime NULL,
		instructorID int NULL,
		testCopy int NULL
	);
	CREATE NONCLUSTERED INDEX IX_Results_deleted ON Results(deleted);
	CREATE NONCLUSTERED INDEX IX_Results_deliveryID ON Results(deliveryID);
	CREATE NONCLUSTERED INDEX IX_Results_sectionID ON Results(sectionID);
	CREATE NONCLUSTERED INDEX IX_Results_siteID ON Results(siteID);
	CREATE NONCLUSTERED INDEX IX_Results_studentID ON Results(studentID);
	SET IDENTITY_INSERT Results ON;
	
